import React from 'react';

function TodoItem0(props) {
	const { it } = props;
	const ListItems = it.map((item) => {
		return (
			<div key={item.id}>
				<span> {item.name}</span>
				<span> {item.age}</span>
			</div>
		);
	});
	return (
		<div>
			<div>
				<span> Name</span>
				<span> Age</span>
				<span>Action</span>
			</div>

			{ListItems}
		</div>
	);
}
export default TodoItem0;
